import React, { Component } from "react";

//Componente riutilizzabile per inserire le immagini
class Card extends Component {
  render() {
    return (
      <div className="col">
        <div className="card" style={{ width: "18rem", textAlign: "center" }}>
          <img src={this.props.card.img}></img>
        </div>
      </div>
    );
  }
}

export default Card;
